import { useParams } from "react-router-dom";
import React, { useState } from "react";
import NavBar from "../components/layout/Navbar";
import "./details.css";

const Details = () => {

    return (
    <div>
     <NavBar />
     <div className="comment-section">
      <h2>Comments</h2>
      <div className="comment">
        <p className="comment-author">John Doe</p>
        <p className="comment-text">This product is amazing!</p>
        <button className="like-button">Like</button>
        <span className="like-count">10</span>
        <button className="dislike-button">Dislike</button>
        <span className="dislike-count">2</span>
      </div>
      <div className="comment">
        <p className="comment-author">Jane Smith</p>
        <p className="comment-text">I have been using this product for a while now, and I love it!</p>
        <button className="like-button">Like</button>
        <span className="like-count">5</span>
        <button className="dislike-button">Dislike</button>
        <span className="dislike-count">1</span>
      </div>
      {/* Add more comments here */}
    </div>

    </div>
  );
};

export default Details;
